public static boolean checkAvailable() 
{
    String state = Environment.getExternalStorageState();
    if (Environment.MEDIA_MOUNTED.equals(state)) {
        return true;
    }
    return false;
}

public static boolean checkWritable(){

	// Retrieving the external storage state
	String state = Environment.getExternalStorageState();

	// Check if writable
	if (Environment.MEDIA_MOUNTED.equals(state)) {
		return true;
	}

	return false;

}

